import LambdaRequest from '../runtime/LambdaRequest';
import { Rules } from '../types';
/**
 * Given a set of rules and a request, return the matching rules. We'll use this feature in
 * the console to show the user which rules are matching for a given request.
 * @param rules
 * @param request
 * @returns
 */
export default function findMatchingRules(rules: Rules[], request: LambdaRequest): number[];
